    false,nt"url": null,nt"notes": "The San Luis Valley was chosen as a contaminant
    study site under the U.S. Fish and Wildlife Service's (Service) Region 6 "Hot Spot"
    study program in 1987. The Service "Hot Spot" studies were designed to monitor
    certain areas for contaminants in fish and wildlife. These "Hot Spots" are of
    significant biological importance and were selected with regard to environmental
    and geological factors that create potential contaminant problems for fish and wildlife.
    In many cases, previous information has suggested the possibility of a contaminant
    problem. Geologically speaking, the northern half of the San Luis Valley is a "closed
    basin" system that contains and accumulates all of the water that enters the northern
    portion of the valley. As a result, this closed basin has a valuable ground water
    supply in the form of both confined and unconfined aquifers (U.S. Geological Survey,
    1989). A network of irrigation and drainage ditches provides some of this water
    to other areas of the valley. With a variety of water sources, especially from the
    surrounding mountains, the valley's water supply could potentially accumulate environmental
    contaminants as it enters the valley and is stored in this unique hydrologic system.
    If present, these contaminants could be trapped in the valley, become available
    to fish and wildlife, and possibly endanger the ground-water supply. Results of
    this study identify three major stream drainages that are apparently being directly
    impacted by past and present mining activity in the area. These streams are Willow
    Creek, Kerber Creek, and Wightman Fork. Biota, water, and sediment samples from
    these areas and downstream sites contain high concentrations of metals including
    aluminum, cadmium, copper, lead, mercury, and zinc. In addition, liver samples from
    great blue herons found dead on Monte Vista National Wildlife Refuge contained high
    concentrations of mercury and selenium.",nt"license_title": "License Not Specified",nt"extras":
